       <SingleComment name ='Jack' date ='Today at 6:00 PM'/>
       <SingleComment name ='Sarah' date ='Today at 7:00 PM'/>
    </div>
    
    )
}
ReactDOM.render(
    <App/>,
    document.querySelector('#root')
)
